import './ascent.css';
import React from 'react';

import apis from '../../api';

class Ascent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            teams: [],
            loading: true,
        };
    }

    componentDidMount = async () => {
        await apis.getTeamsByMap('Ascent').then(res => {
            this.setState({
                teams: res.data.data,
                loading: false,
            })
        })
    }

    render() {
        const { teams, loading } = this.state;

        if (loading) return null;

        return (
            <div>
                {teams[0].team}
                <ul>
                    {teams.map(item => {
                        return <li>{item.team}</li>;
                    })}
                </ul>
            </div>
        )
    }
};

export default Ascent;
